import com.tbuk.psd2.model.common.BankAccount;

@Service
public class AisService {

	
	public List<BankAccount> getAccountsList(){

		List<BankAccount> list=new ArrayList<BankAccount>();
		list.add(bankAcc1());
		list.add(bankAcc2());
		return list;
	}

	
	public AccountDetail getAccountDetail(String accountId){

		AccountDetail a=AccountDetail.builder().balance(1000.20).bankAccount(bankAcc1()).build();
		return a;

	}

	public Double getBalance(String accountId){
		return  1000.20;
	}

	public List<AccountTransaction> getAccountTransactions(){

		List<AccountTransaction> list=new ArrayList<>();
		list.add(accountTransaction1());
		list.add(accountTransaction2());
		return list;
	}
	
	public Statement getStatement(){
		String base64="";
		// dosyadan base64 asagidaki gibi olusturacaksin. Ben hazir bir tane urettim..
	// hazir urettigim dosyanin ne oldugunu gormek istersen StatementBase64Utils convertToFile metodunu kullanabilirsin
		// sen statement dosyasini asagidaki comment li yeri acarak uretebilirsin
	//       		try{
	//       			String filePath="c://statements/statement1.pdf";
	//			   base64=StatementBase64Utils.convertToBase64(filePath);
 	//           }catch (Exception ex){}
		Statement s= Statement.builder().fileName("statement1.pdf")
				  .statementDate(new Date().getDate(LocalDate.of(2019,8,2)))
				  .base64StatementFile(base64).build();
	return s;
	}


	private BankAccount bankAcc1(){
		BankAccount b=new BankAccount();
		b.setAccountId("001");
		b.setAccountNo("08371199");
		b.setAccountSubType(AccountSubType.CURRENT_ACCOUNT);
		b.setBicCode("TBUKGB2L");
		b.setCurrency(Currency.GBP);
		b.setName("OMER AYAN");
		b.setIban("GB93TUBA40519808371199");
		b.setStatementAvailable(true);
		b.setSortCode("405033");
		return b;
	}
	private BankAccount bankAcc2(){
		BankAccount b=new BankAccount();
		b.setAccountId("0002");
		b.setAccountNo("08351341");
		b.setAccountSubType(AccountSubType.CURRENT_ACCOUNT);
		b.setBicCode("TBUKGB2L");
		b.setCurrency(Currency.EUR);
		b.setName("OMER AYAN");
		b.setIban("GB43TUBA40519808351341");
		b.setStatementAvailable(false);
		b.setSortCode("405033");
		return b;
	}

	private AccountTransaction accountTransaction1(){
		AccountTransaction t=AccountTransaction.builder().amount(20)
				                                         .chargeInfo(Charge.builder().amount(1.0).build())
														 .amount(450.0)
														.currency(Currency.GBP)
				                                         .description("Amazon.co.uk")
														.from(bankAcc1())
				                                        .to(BankAccount.builder().name("amazon.co.uk").build())
														.referenceId("1111")
														.status(TransactionStatus.SUCCESS)
														.transactionId("trnsct3429").build();
		return t;
	}
	private AccountTransaction accountTransaction2(){
		AccountTransaction t=AccountTransaction.builder().amount(20)
				.chargeInfo(Charge.builder().amount(1.0).build())
				.amount(450.0)
				.currency(Currency.GBP)
				.description("Amazon.co.uk")
				.from(bankAcc1())
				.to(BankAccount.builder().name("amazon.co.uk").build())
				.referenceId("1111")
				.status(TransactionStatus.SUCCESS)
				.transactionId("trnsct3429").build();
		return t;
	}

}
